import React from 'react'
import {Checkbox} from "antd";



/*
*
<CheckboxComp
    label = ""
/>
*
* */
function onChange(e) {
    console.log(`checked = ${e.target.checked}`);
}

class CheckboxComp extends React.Component{
    render(){
        const {myprop} = this.props;
        return(
            <Checkbox
                style = {{margin: '10px'}}
                onChange={onChange}
            >
                {this.props.label}
            </Checkbox>
        )
    }
}

export {CheckboxComp}
